function wH(){var a=Ka({za:!0,title:"Shortcuts"});var b="<b>List of keyboard shortcuts:</b><br/><br/>";or()||(b+="More shortcuts will appear in this list later as you progress through the game.<br/><br/>");b+='Note: on mac, ctrl means command instead.<br/><br/> \u2022 <b>esc</b>: close current dialog. If no dialogs are open, shows main menu.<br/> \u2022 <b>"p"</b>: when crop in field under mouse cursor: pick (select) this crop for planting (no mouse click required)<br/> \u2022 <b>"p"</b>: when empty field mouse cursor: plant the selected crop here (no mouse click required)<br/> \u2022 <b>"d"</b>: delete crop under mouse cursor (no mouse click required)<br/> \u2022 <b>"u"</b>: upgrade tier: replace crop or template under mouse cursor with highest available tier of the same type that you can afford (no mouse click required)<br/> \u2022 <b>"shift+d"</b>: downgrade tier, in ethereal field<br/> \u2022 <b>shift + click empty field</b>: plant last planted or unlocked crop type.<br/> \u2022 <b>ctrl + click empty field</b>: plant a watercress (does not affect last planted type for shift key).<br/> \u2022 <b>ctrl + click non-empty field</b>: delete crop.<br/> \u2022 <b>shift + click non-empty field</b>: replace crop.<br/> \u2022 <b>ctrl + shift + click field</b>: upgrade tier: replace crop or template with highest unlocked tier (if enabled in preferences), pick this crop type as last planted, and on empty field, plant highest tier of picked crop type you can afford.<br/> \u2022 <b>"w"</b>: replant watercress on all field tiles that have a watercress remainder, and refresh existing ones. Such a remainder appears for watercress that have been copying from multiple plants, that is, a good copying spot. Copying has diminishing returns if there are multiple watercress anywhere on the map, 1 or 2 is effective (check the seeds/s income to view the effect).<br/> \u2022 <b>"t"</b>: show transcend dialog (if available)<br/> \u2022 <b>"f"</b>: go to the basic field tab<br/> \u2022 <b>"e"</b>: go to the ethereal field tab (if available)<br/> \u2022 <b>"i"</b>: go to the infinity field tab (if available)<br/> \u2022 <b>"ctrl + z"</b>: undo / redo<br/> \u2022 <b>], }, ) or ></b>: select next active fruit. Can be changed in the preferences under "controls" to instead select next game tab.<br/> \u2022 <b>[, {, ( or <</b>: select previous active fruit. Can be changed in the preferences under "controls" to instead select previous game tab.<br/> \u2022 <b>number keys "1-9"</b>: by default, select fruit slot (when available). Can be changed in the preferences under "controls" to instead activate weather or change game tabs.<br/> \u2022 <b>"shift" + number keys "1-9"</b>: by default, activate weather (1-3). Can be changed in the preferences under "controls" to instead select fruit slots or change game tabs.<br/>';0<
B.vc&&(b+="<br/><b>Fruits tab:</b><br/><br/> \u2022 <b>ctrl + click fruit</b>: move fruit between sacrificial and storage slots, if possible.<br/> \u2022 <b>shift + click fruit</b>: same as ctrl + click fruit.<br/> \u2022 <b>shift + click fruit ability upgrade</b>: buy multiple abilities up to 25% of currently available essence.<br/>");or()&&(b+='<br/><b>Blueprints:</b><br/><br/> \u2022 <b>"b"</b>: open the blueprint library, when available.<br/> \u2022 <b>"t" followed by "b"</b>: transcend and open the transcend-with-blueprint dialog.<br/> \u2022 <b>"t" followed by "Enter"</b>: transcend without blueprint.<br/> \u2022 <b>"t" followed by "c"</b>: transcend and open the start-new-challenge dialog.<br/> \u2022 <b>number keys "1-9" in blueprint selection dialog</b>: open or use this blueprint<br/> \u2022 <b>"shift" + number keys "1-9" in blueprint selection dialog</b>: plant this blueprint (overriding)<br/> \u2022 <b>"p" in blueprint selection dialog</b>: toggle page 1 / page 2<br/> \u2022 <b>shift + click blueprint</b>: immediately plant this blueprint, rather than opening its edit screen.<br/> \u2022 <b>shift + click blueprint "To Field"</b>: plant this blueprint, but let it override non-matching crops. Without shift, it only plants on empty field spots.<br/> \u2022 <b>shift + click squirrel upgrade</b>: when you unlocked this type of upgrades and have respecced at least once: upgrade all upgrades until this one, only available if you can afford it and this upgrade was seen before.<br/> \u2022 <b>"f" in blueprint editing dialog</b>: set blueprint from field.<br/> \u2022 <b>"enter" in blueprint editing dialog</b>: plant blueprint (overriding).<br/>');
a.content.a.innerHTML=b+"<br/><b>Special button actions:</b><br/><br/> \u2022 <b>shift + click upgrade</b>: buy as many of this upgrade as you can afford.<br/> \u2022 <b>shift + click undo</b>: save the undo state now, rather than load it. This overwrites your undo so eliminates any chance of undoing now. This will also be overwritten again if you do actions a minute later.<br/> \u2022 <b>shift + click save import dialog</b>: import and old savegame, but force paused state, do not run the time, so you get the resources and season at the time of saving rather than with all production during that time added.<br/> \u2022 <b>ctrl + click save import dialog</b>: import and old savegame, but force non-paused state, even if the savegame was saved while paused, this will cause all time between saving and now to be ran.<br/><br/><br/>"}
